Non</photoshop:Category>\r\n			<photoshop:ColorMode>3</photoshop:ColorMode>\r\n			<photoshop:ICCProfile>Adobe RGB (1998)</photoshop:ICCProfile>\r\n			<photoshop:DateCreated>1996-10-18</photoshop:DateCreated>\r\n			<photoshop:SupplementalCategories>\r\n				<rdf:Bag>\r\n					<rdf:li>SCI</rdf:li>\r\n				</rdf:Bag>\r\n			</photoshop:SupplementalCategories>\r\n			<photoshop:History/>\r\n		</rdf:Description>\r\n		<rdf:Description rdf:about=\"\" xmlns:xapMM=\"http://ns.adobe.com/xap/1.0/mm/\">\r\n			<xapMM:DocumentID>adobe:docid:photoshop:b1df101a-ff05-11d6-b800-8abe1c33cdcb</xapMM:DocumentID>\r\n			<xapMM:InstanceID>uuid:38B2288954FDDF11B5C5A2E3936D8DA4</xapMM:InstanceID>\r\n		</rdf:Description>\r\n		<rdf:Description rdf:about=\"\" xmlns:xapRights=\"http://ns.adobe.com/xap/1.0/rights/\">\r\n			<xapRights:WebStatement>www.nmsi.ac.uk/piclib/</xapRights:WebStatement>\r\n			<xapRights:Marked>True</xapRights:Marked>\r\n		</rdf:Description>\r\n		<rdf:Description rdf:about=\"\" xmlns:dc=\"http://purl.org/dc/elements/1.1/\">\r\n			<dc:rights>\r\n				<rdf:Alt>\r\n					<rdf:li xml:lang=\"x-default\">Please read our licence terms. All digital images must be destroyed unless otherwise agreed in writing.</rdf:li>\r\n				</rdf:Alt>\r\n			</dc:rights>\r\n			<dc:format>image/jpeg</dc:format>\r\n			<dc:description>\r\n				<rdf:Alt>\r\n					<rdf:li xml:lang=\"x-default\">GERMANY - OCTOBER 18:  A four-rotor German Enigma cypher machine with a second operator display (a \'remote lampboard\'), made during World War II. This type of machine, devised by the German Navy in 1939, was used to encode wartime messages requiring a particularly high degree of security. The cracking of German cypher codes by Allied intelligence was a major achievement in cryptanalysis and played a key role in the outcome of the North Atlantic U-boat engagements. The search to crack the the Enigma codes also resulted in ?Colossus?, the first all-electronic digital computer. This rare machine is thought to have been used in the post-war years for coding diplomatic traffic in Switzerland.  (Photo by SSPL/Getty Images)</rdf:li>\r\n				</rdf:Alt>\r\n			</dc:description>\r\n			<dc:creator>\r\n				<rdf:Seq>\r\n					<rdf:li>Science &amp; Society Picture Librar</rdf:li>\r\n				</rdf:Seq>\r\n			</dc:creator>\r\n			<dc:title>\r\n				<rdf:Alt>\r\n					<rdf:li xml:lang=\"x-default\">10303586</rdf:li>\r\n				</rdf:Alt>\r\n			</dc:title>\r\n			<dc:subject>\r\n				<rdf:Bag>\r\n					<rdf:li>WWII|Enigma|four-rotor|cipher</rdf:li>\r\n					<rdf:li>machines|information</rdf:li>\r\n					<rdf:li>technology|IT|radio</rdf:li>\r\n					<rdf:li>communication|cryptography|cryptology|codes|decoding|encoding|en</rdf:li>\r\n					<rdf:li>equipment|code-breaking|codes|Colossus|Scherbius|Arthur</rdf:li>\r\n				</rdf:Bag>\r\n			</dc:subject>\r\n		</rdf:Description>\r\n		<rdf:Description rdf:about=\"\" xmlns:tiff=\"http://ns.adobe.com/tiff/1.0/\">\r\n			<tiff:XResolution>3000000/10000</tiff:XResolution>\r\n			<tiff:YResolution>3000000/10000</tiff:YResolution>\r\n			<tiff:ResolutionUnit>2</tiff:ResolutionUnit>\r\n			<tiff:NativeDigest>256,257,258,259,262,274,277,284,530,531,282,283,296,301,318,319,529,532,306,270,271,272,305,315,33432;14658D29B1716640FE9F632788DA91FD</tiff:NativeDigest>\r\n		</rdf:Description>\r\n		<rdf:Description rdf:about=\"\" xmlns:xap=\"http://ns.adobe.com/xap/1.0/\">\r\n			<xap:ModifyDate>2010-12-01T14:42:44Z</xap:ModifyDate>\r\n			<xap:CreatorTool>Adobe Photoshop CS2 Windows</xap:CreatorTool>\r\n			<xap:CreateDate>2010-12-01T04:13:16Z</xap:CreateDate>\r\n			<xap:MetadataDate>2010-12-01T14:42:44Z</xap:MetadataDate>\r\n		</rdf:Description>\r\n		<rdf:Description rdf:about=\"\" xmlns:exif=\"http://ns.adobe.com/exif/1.0/\">\r\n			<exif:ColorSpace>-1</exif:ColorSpace>\r\n			<exif:PixelXDimension>640</exif:PixelXDimension>\r\n			<exif:PixelYDimension>360</exif:PixelYDimension>\r\n			<exif:NativeDigest>36864,40960,40961,37121,37122,40962,40963,37510,40964,36867,36868,33434,33437,34850,34852,34855,3485